import React from "react";
import Modal from "react-modal";

const ModalDelete = ({ polling, setPolling, deleteOpen, setDeleteOpen }) => {
  // Functions
  const deleteClose = () => {
    setDeleteOpen(false);
  };

  return (
    <React.Fragment>
      <Modal
        isOpen={deleteOpen}
        onRequestClose={deleteClose}
        className="modal-background"
        overlayClassName="modal-overlay"
      >
        <div></div>
      </Modal>
    </React.Fragment>
  );
};

export default ModalDelete;
